  const navigate = useNavigate();

  return (
    <div className="dashboard-container">
      <h1>Welcome, Doctor üë®‚Äç‚öïÔ∏è</h1>
      <div className="dashboard-grid">
        <div className="dashboard-card" onClick={() => navigate("/doctor-profile")}>
          View Profile
