        <div className="dashboard-card" onClick={() => navigate("/edit-profile")}>
          Edit Profile
        </div>
        <div className="dashboard-card" onClick={() => navigate("/doctor-appointments")}>
          View Appointments
        </div>
      </div>
    </div>
  );
};

export default DoctorDashboard;
